import './App.css';
import Title from "./components/Title"
import { Heading, Box } from "@chakra-ui/react"


function App() {




  return (
    <Box>
      <Title />
      <form id="todo">
        <label for="input">Todo: </label>
        <input
          type="text"
          id="input"
          name="input" 
          placeholder='Enter your input here' 
          />
        <button type="button" form='todo'>Submit</button>
      </form>
      <Todos />
    </Box>


    );
}

export default App;
